(160, 9, 'simple', NULL, 59, 'Brown', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2008-07-24 18:24:15', NULL, NULL, '', 'Our most advanced trackball yet: a comfortable, cordless, finger-operated trackball that works where you need it. Save space and eliminate desktop clutter. Take advantage of extra buttons that help you navigate around Windows and the web more easily. And with Logitech''s patented optical technology, you get virtually maintenance-free precision and smooth tracking.', NULL, 0, NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, '/2/6/268832809_1.jpg', NULL, NULL, 0, NULL, NULL, NULL, 121, 'Logitech', NULL, NULL, NULL, NULL, NULL, '', '', '', NULL, NULL, NULL, '4', 2, 'Logitech Cordless Optical Trackman', '2013-01-01 00:00:00', NULL, NULL, '79.9900', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Our most advanced trackball yet. It''s comfortable, cordless, finger-operated and works where you need it. Save space and eliminate desktop clutter.', 'logitechcord', NULL, '/2/6/268832809_1.jpg', NULL, NULL, NULL, NULL, 1, '/2/6/268832809_1.jpg', NULL, '2013-01-25 10:32:48', 'microsoft-wireless-optical-mouse-5000', 'microsoft-wireless-optical-mouse-5000.html', 4, '1.0000', NULL),
(161, 9, 'simple', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2008-07-24 18:25:09', NULL, NULL, '', 'PerfectStroke key system for the ultimate keyboard feel. Bluetooth wireless and Li-Ion powered. Stylishly sleek with its elegant charging base and backlit controls, the diNovo Edge makes a bold statement.\r\n\r\nAn ideal partner for any high-end computer, the ultra-slim Logitech diNovo Edge delivers the ultimate in feel and response. The revolutionary TouchDisc with hyper-speed scrolling and pixel-perfect control makes trackpads obsolete. A slim recharging base doubles as a keyboard stand. Work longer thanks to the longer-lasting Li-Ion batteries, and more securely via Bluetooth wireless technology. Combine it with the world''s most advanced mouse, the Logitech MX Revolution, for a premium desktop experience!', NULL, 0, NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, '/g/u/gucci-baby-diaper-bag-123326.jpg', NULL, NULL, 0, NULL, NULL, NULL, 121, 'Logitech', NULL, NULL, NULL, NULL, NULL, '', '', '', NULL, NULL, NULL, '4', 2, 'Logitech diNovo Edge Keyboard', NULL, NULL, NULL, '239.9900', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'PerfectStroke key system for the ultimate keyboard feel. Bluetooth wireless and Li-Ion powered.', 'logidinovo', NULL, '/g/u/gucci-baby-diaper-bag-123326.jpg', NULL, NULL, NULL, NULL, 0, '/g/u/gucci-baby-diaper-bag-123326.jpg', NULL, '2013-01-25 10:31:37', 'logitech-dinovo-edge-keyboard', 'logitech-dinovo-edge-keyboard.html', 4, '1.0000', NULL),
