(34, 40, 'simple', NULL, 24, 'Black', NULL, NULL, NULL, NULL, '29.9900', NULL, NULL, NULL, '2007-08-24 12:27:04', NULL, NULL, '', 'High fashion and classic good looks converge in this suave slip on from Kenneth Cole. Smooth leather upper in a dress slip on style, with a stitched and covered seam moc-inspired square toe, quarter panel curved overlays and flared tongue with side elastic panels for a comfortable, secure fit. Smooth leather lining, cushioned leather topped insole. Dress midsole with a beveled edge, 1 inch capped dress heel. Flat traction outsole.', NULL, NULL, NULL, NULL, 36, 'Mens', 0, NULL, NULL, 0, '/k/e/kenneth-cole-new-york-men-s-con-verge-slip-on-2.jpg', NULL, 'The handsome style of the Con-Verge slip-on from Kenneth Cole New York is larger than life. This sharp shoe has a semi-polished smooth leather upper, a squared off stitched apron toe, and dual-goring for easy on/off accessibility. It also features soft leather linings, a cushioned insole, and a paneled rubber outsole for a sturdy step. The Con-Verge is a perfect companion to your business and special occasion wardrobes.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Kenneth Cole New York Men''s Con-verge Slip-on', 'Kenneth Cole New York Men''s Con-verge Slip-on', 'Kenneth Cole New York Men''s Con-verge Slip-on', '160.9900', 'B000IKC6AY', NULL, NULL, NULL, 'Kenneth Cole New York Men''s Con-verge Slip-on', NULL, NULL, NULL, '160.9900', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 41, '8', 52, 'Dress', 'High fashion and classic good looks converge in this suave slip on from Kenneth Cole. Smooth leather upper in a dress slip on style, with a stitched and covered seam moc-inspired square toe, quarter panel curved overlays and flared tongue', 'ken_8', NULL, '/k/e/kenneth-cole-new-york-men-s-con-verge-slip-on-3.jpg', NULL, NULL, NULL, NULL, 2, '/k/e/kenneth-cole-new-york-men-s-con-verge-slip-on-4.jpg', NULL, '2008-08-07 17:58:35', 'ke