(95, 40, 'simple', NULL, 61, 'Gray', NULL, NULL, NULL, NULL, '29.9900', NULL, NULL, NULL, '2007-08-24 12:00:49', NULL, NULL, '', 'The ASICS® GEL-Kayano® XII running shoe delivers the ultimate blend of cushioning and support. Biomorphic Fit™ upper offers enhanced upper fit and comfort while decreasing the potential for irritation. Solyte midsole material is lighter than standard EVA and SpEVA® combined with improved cushioning and durability. Impact Guidance System (I.G.S.®) uses linked componentry to encourage optimal gait while allowing for natural foot movement from heel strike to toe off. DuoMax® support system helps ensure that the shoe maintains proper support for the foot during the critical transition from heel strike to toe off. Space Trusstic® System creates a pocket between the Trusstic® System device and the midsole, allowing for greater midsole deformation and more efficient foot function. GEL® Cushioning System provides maximum rearfoot and forefoot shock attenuation. Wt. 12.6 oz.', NULL, NULL, NULL, NULL, 36, 'Mens', 0, NULL, NULL, 0, 'no_selection', NULL, '# I.G.S.?: Allows for natural foot movement from heel strike to toe-off\r\n# DuoMax? Support System: Maintains proper support for the foot during the critical transition from heel strike to toe-off\r\n# Space Trusstic System?: Allows for greater midsole deformation and more efficient foot function\r\n# GEL? Cushioning System: Provides maximum rearfoot/forefoot shock attenuation\r\n# Biomorphic Fit Upper: Provides enhanced upper fit and comfort while limiting irritation', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ASICS® Men''s GEL-Kayano® XII', 'ASICS® Men''s GEL-Kayano® XII ', 'ASICS® Men''s GEL-Kayano® XII', '134.9900', 'B000CP1M00', NULL, NULL, NULL, 'ASICS® Men''s GEL-Kayano® XII', NULL, NULL, NULL, '134.9900', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 39, '10', 49, 'Running', 'The ASICS® GEL-Kayano® XII running shoe delivers t