(135, 40, 'configurable', NULL, 59, 'Brown', NULL, NULL, NULL, NULL, '10.0000', NULL, NULL, NULL, '2007-08-30 04:22:53', NULL, NULL, '', 'Smooth kidskin upper in a dress platform wedge t-strap sandal style, with a round open toe, front and ankle adjustable buckles and tonal stitching accents. Ankle buckle features elastic panel. Smooth faux leather lining, cushioning faux leather and fabric topped insole. 1 inch matching leather and fabric wrapped midsole.', NULL, NULL, NULL, NULL, 35, 'Womens', 0, NULL, NULL, 1, '/a/n/anashria-womens-premier-leather-sandal.jpg', NULL, '<ul>\r\n<ul class="disc">\r\n<li>Womens Style <br></li>\r\n<li>Genuine Top Grain Premier Leather <br></li>\r\n<li>Rich Color Tones <br></li>\r\n<li>Straps lined with 2000 lb test nylon <br></li>\r\n<li>Guaranteed for the Life of the Sole - Non-slip sole<br></li>\r\n</ul>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Anashria Womens Premier Leather Sandal', 'womens, sandal, leather, anashria, ', 'Anashria Womens Premier Leather Sandal', '41.9500', 'B000KJ43SG!', NULL, NULL, NULL, 'Anashria Womens Premier Leather Sandal', NULL, NULL, NULL, '41.9500', NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 97, 'Sandal', 'Buckle embellished contrasting straps adorn both the heel and canvas covered wedge of this t-strap sandal to make it a truly unique addition to your wardrobe', 'ana', NULL, '/a/n/anashria-womens-premier-leather-sandal.jpg', NULL, NULL, NULL, NULL, 2, '/a/n/anashria-womens-premier-leather-sandal.jpg', NULL, '2008-08-08 08:06:02', 'anashria-womens-premier-leather-sandal', 'anashria-womens-premier-leather-sandal.html', 4, '2.0000', NULL),
(138, 9, 'simple', NULL, 24, 'Black', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2008-07-24 17:52:03', NULL, NULL, '', 'This superb, multi-functional Aspire X-Cruiser mid tower case is designed to follow Intel''s recommendations to achieve the highest level of thermal performance. This gorgeous case outperforms most of the expensive chassis in the market, boasts an abundance of innovative features, yet carries a very affordable price tag. The Aspire X-Cruiser is fully loaded with everything you could possibly imagine that a great gaming case could have. With a built-in air duct on the side panel to funnel cool air towards the CPU, the fan-less X-Cruiser is specially designed to bring out the best performance in systems based on high-end processors.', NULL, 0, NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, '/v/e/veg1354513674_7.jpg', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', NULL, NULL, NULL, '4', 2, 'Apevia Black X-Cruiser Case ATX Mid-Tower Case (Default)', NULL, NULL, NULL, '150.0000', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'This magnificent new case features 2 x 80mm built-in fans with space for 2 optional fans. The Aspire X-Cruiser features front temperature gauge, front fan speed controller and gauge, and front volume controller and gauge. It also features USB2.0, Firewire and audio ports. The superior cooling solution that X-Cruiser delivers can only be found in very few of the expensive chassis in the market.', 'apevia-black', NULL, '/v/e/veg1354513674_7.jpg', NULL, NULL, NULL, NULL, 1, '/v/e/veg1354513674_7.jpg', NULL, '2013-02-06 18:43:41', 'apevia-black-x-cruiser-case-atx-mid-tower-case', 'apevia-black-x-cruiser-case-atx-mid-tower-case.html', 4, '10.0000', NULL),
(139, 9, 'simple', NULL, 23, 'Silver', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2008-07-24 17:54:41', NULL, NULL, '', 'Introducing the next advancement in case design and technology, the Lexa. Designed from ground up to be symmetrical, the Lexa is representative of the modern lifestyle design cues of today. The Lexa''s minimalist and classy design fits perfectly under the NZXT Classic Series line.', NULL, 0, NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, '/b/a/balada.jpg', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', NULL, NULL, NULL, '4', 2, 'NZXT Lexa Silver Aluminum ATX Mid-Tower Case (Default)', '2013-01-01 00:00:00', NULL, NULL, '199.9900', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'The Lexa boasts a ridgid, but light weight aluminum chassis. The Lexa''s high-air-flow design, while quiet, ensures cooling options for the more ambitious computing enthusiasts. Three thermal probes provide temperature readings to the illuminated LCD display for monitoring your systems core components. The Lexa ships with a rugged carrying strap with protective window cover for easy single-handed transportation.', 'nzxtlexa', NULL, '/b/a/balada.jpg', NULL, NULL, NULL, NULL, 1, '/b/a/balada.jpg', NULL, '2013-01-25 10:52:58', 'nzxt-lexa-silver-aluminum-atx-mid-tower-case', 'nzxt-lexa-silver-aluminum-atx-mid-tower-case.html', 4, '10.0000', NULL),
