(148, 60, 'simple', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 115, '2.0 GHz', '2008-07-24 18:10:21', NULL, NULL, '', 'Frustrated by staring at the hourglass icon as soon as you try to work on more than three programs at once, especially when you’re working with digital media? Increase your performance with the AMD Athlon™ 64 X2 dual core processor. Work or play with multiple programs without any stalling or waiting. Dual-core technology is like having two processors, and two working together is better and faster than one working alone. Do more in less time with the AMD Athlon 64 X2 dual-core processor.', NULL, 0, NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, '/d/2/d26db_1353919185-dao-cao-rau1.jpg', NULL, NULL, 0, NULL, NULL, NULL, 117, 'AMD', NULL, NULL, NULL, NULL, NULL, '', '', '', NULL, NULL, NULL, '4', 2, 'AMD A64 X2 3800+ 2.0GHz OEM', NULL, NULL, NULL, '98.9900', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'AMD Athlon 64 X2 3800+ Processor ADO3800IAA5CZ - 2.0GHz, 2 x 512KB Cache, 1000MHz (2000 MT/s) FSB, Windsor, Dual Core, OEM, Socket AM2, Processor', 'amda64', NULL, '/d/2/d26db_1353919185-dao-cao-rau1.jpg', NULL, NULL, NULL, NULL, 1, '/d/2/d26db_1353919185-dao-cao-rau1.jpg', NULL, '2013-01-25 10:48:48', 'amd-a64-x2-3800-2-0ghz-oem', 'amd-a64-x2-3800-2-0ghz-oem.html', 4, '1.0000', NULL),
