>\r\n<li> Wherever you are, you have high speed access to the internet with EDGE technology<br></li>\r\n<li> A full-function email client in your W810 gives you access to your inbox wherever you go</li>\r\n</ul>', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'The W810i follows a long tradition of beautifully designed and crafted phones from Sony Ericsson. The same candy-bar style that graced the W800 is here, as is the horizontally-oriented camera unit on the back of the phone, allowing you to hold the phone j', 'Sony, Ericsson ,W810i, cell, phone', 'Sony Ericsson W810i', '399.9900', 'W810i', NULL, '4', 2, 'Sony Ericsson W810i', '2013-01-01 00:00:00', NULL, NULL, '399.9900', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'The W810i follows a long tradition of beautifully designed and crafted phones from Sony Ericsson. The same candy-bar style that graced the W800 is here.', 'sw810i', NULL, '/g/a/galaxy-s-ii-product-image-21_1_1.jpg', NULL, NULL, NULL, NULL, 2, '/g/a/galaxy-s-ii-product-image-21_1_1.jpg', NULL, '2013-01-25 02:19:55', 'sony-ericsson-w810i', 'sony-ericsson-w810i.html', 4, '13.6000', NULL),
(19, 38, 'simple', 'Conditional $250 Equipment Discount Included: Your price paid includes an equipment discount of $250 that has been provided to you in exchange for either activating a new, non-substitute line of service or renewing an existing line of service with AT&T and your agreement that for the 181-day period following such activation or renewal you will: (1) pay your balance due to AT&T each month and otherwise maintain your account in good standing; (2) not disconnect this AT&T line of service; (3) not transfer this equipment to another AT&T line of service; (4) not change your AT&T service rate plan to a lower monthly service rate--this includes canceling or removing required PDA, BlackBerry, or smartphone features after your product has shipped; (5) not use this line of service to replace an existing account with AT&T. If these conditions are not met, you hereby authorize Magento.com to charge your credit card $250 as reimbursement of this equipment discount without need for further approval.', 23, 'Silver', NULL, NULL, NULL, NULL, '29.9900', NULL, NULL, NULL, '2007-08-23 08:55:29', NULL, NULL, '', ' The design of the 8525 is clean and uncluttered, with just a few buttons for mail, Internet Explorer, and contextual menus. Meanwhile, call answer and end buttons surround a five-way toggle that allows you to navigate and control the Windows Mobile interface. As mentioned, a full QWERTY keyboard cleverly slides out from underneath the screen. This allows you to hold the device horizontally, and the screen is automatically placed in landscape mode when you''re using the keyboard. A side scroll wheel is conveniently tucked away on the side, making navigation when accessing the music player and other various applications a cinch when needed. A mini-SD memory expansion card slot is provided, as is an infrared port and support for a stereo Bluetooth headset. A mini-USB port is also included for wired data transfers and charging.', '4.4 x 2.4 x 0.9 inches', 0, NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, '/n/o/nokia600_4.jpg', NULL, '<ul>\r\n<ul class="disc">\r\n<li>tri-band UMTS/HSDPA; quad-band GSM/GPRS/EDGE for global use<br></li>\r\n<li>Windows Mobile 5.0 with Messaging & Security Feature Pack<br></li>\r\n<li>sliding QWERTY keyboard with improved keypad design and improved backlight for easier use in low light conditions<br></li>\r\n<li>128MB ROM / 64MB RAM; ~51MB user available memory<br></li>\r\n<li>2.0 mega-pixel camera with video capabilities</li>\r\n</ul>', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'nder the hood, the 8525 features 128MB of embedded memory and 64MB RAM, running on a 400 MHz Samsung processor. Up front, the 240 x 320 LCD touch-screen supports over 65,000 colors, while the rear of the device houses a 2.0 megapixel camera. The design of', 'At&t, 8525, cell, phone', 'AT&T 8525 PDA Phone', '199.9900', '8525 PDA', NULL, '4', 2, 'AT&T 8525 PDA', NULL, NULL, NULL, '199.9900', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Under the hood, the 8525 features 128MB of embedded memory and 64MB RAM, running on a 400 MHz Samsung processor. Up front, the 240 x 320 LCD touch-screen supports over 65,000 colors, while the rear of the device houses a 2.0 megapixel camera.', '8525PDA', NULL, '/n/o/nokia600_4.jpg', NULL, NULL, NULL, NULL, 2, '/n/o/nokia600_4.jpg', NULL, '2013-01-25 02:15:46', 'atandt-8525-pda', 'atandt-8525-pda.html', 4, '30.0000', NULL),
(20, 38, 'simple', 'CONDITIONAL $250 Equipment Discount Included: Your price paid includes an equipment discount of $250 that has been provided to you in exchange for activating a new, non-substitute line of service with Sprint and your agreement that for the 181-day period following such activation you will (1) pay your balance due to Sprint each month and otherwise maintain your account in good standing, (2) not disconnect this Sprint line of service, (3) not transfer this equipment to another Sprint line of service, (4) not change your Sprint service rate plan to a lower monthly service rate--this includes canceling or removing required PDA, BlackBerry, or smartphone features after your product has shipped, and (5) not use this line of service to replace an existing account with Sprint. If these conditions are not met, you hereby authorize Magento.com to charge your credit card $250 as reimbursement of this equipment discount without need for further approval.', 23, 'Silver', NULL, NULL, NULL, NULL, '29.9900', NULL, NULL, NULL, '2007-08-23 11:06:42', NULL, NULL, '', 'New services supported by both the MM-A900m include the newly announced Sprint Music StoreSM, which allows users to immediately buy and download complete songs directly to their phone; 30 channels of live and on demand video and audio from Sprint TVSM and On Demand, a personalized resource guide to news, traffic, weather, sports and entertainment. The MM-A900m offers great-looking design with the ability to download a rich selection of content directly to the phone. Features like external music-navigation keys make these phones both functional and attractive. These handsets are sure to be at the top of many wish lists.', '3.9 x 2 x 0.6 inches', 0, NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, '/n/o/nokia600_4_1_1.jpg', NULL, '<ul>\r\n<ul class="disc">\r\n<li>Bluetooth Wireless Technology: Built-in radio technology allows fast, secure transmission between your phone and accessories without cables or wires. Bluetooth wireless accessories are sold separately.<br></li>\r\n<li>Mass Storage Area: Store pictures, videos, voice memos and music within the internal memory of the phone.<br></li>\r\n<li>Streaming Music Enabled: Stream music to your phone with Music Choice®. Select from Pop, Rock, Hip Hop, and R&B plus exclusive video clips, performances, and artist interviews.<br></li>\r\n</ul>\r\n   ', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'New services supported by both the MM-A900m include the newly announced Sprint Music StoreSM, which allows users to immediately buy and download complete songs directly to their phone', 'Samsung, MM-A900M, cell, phone', 'Samsung MM-A900M Ace Phone', '150.0000', 'MM-A900M', NULL, '4', 2, 'Samsung MM-A900M Ace', NULL, NULL, NULL, '150.0000', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'The MM-A900m offers great-looking design with the ability to download a rich selection of content directly to the phone. ', 'MM-A900M', NULL, '/n/o/nokia600_4_1_1.jpg', NULL, NULL, NULL, NULL, 2, '/n/o/nokia600_4_1_1.jpg', NULL, '2013-01-25 02:19:48', 'samsung-mm-a900m-ace', 'samsung-mm-a900m-ace.html', 4, '1.0000', NULL),
(25, 39, 'simple', NULL, 23, 'Silver', 77, 'Apple', NULL, NULL, '1299.9900', NULL, NULL, NULL, '2007-08-24 07:28:50', NULL, NULL, '', 'This, combined with myriad other engineering leaps, boosts performance up to four times higher than the PowerBook G4. With this awesome power, it''s a breeze to render complex 3D models, enjoy smooth playback of HD video, or host a four-way video conference.Intel Core Duo is the first chip built using Intel''s groundbreaking 65-nanometer process - resulting in transistors so small, you could fit a hundred inside a single human cell. With smaller distances for electrons to travel, and two processors designed to share resources and conserve power, Intel Core Duo achieves higher levels of performance as it uses fewer watts. Which is what makes it possible to design a super-powerful MacBook Pro that''s only one inch thin.When Mac technology makes something easy, it''s hardly news. So here''s more non-news for MacBook Pro owners: software just works. If you see the Universal logo on a new application, that means it will run on Intel- and PowerPC-based Mac computers. For most existing applications, you simply do what you''ve always done: double-click them. Thanks to the Rosetta technology in Mac OS X, they look and feel just like they did before.', '19.5 x 7.6 x 19.5 inches', 0, NULL, NULL, NULL, NULL, 0, NULL, '100 GB 5400 rpm Serial ATA hard drive', 1, '/s/e/sell-apple-macbook-pro-mc700ll-a-13-3-inch-laptop_5.jpg', NULL, ' <ul>\r\n<ul class="disc">\r\n<li>2.0 GHz Intel Core Duo processor with 2 MB shared L2 Cache<br></li>\r\n<li>1 GB (single SODIMM) 667 MHz DDR2 SDRAM (PC2-5300); 100 GB 5400 rpm Serial ATA hard drive; slot-load SuperDrive (DVD±RW/CD-RW)<br></li>\r\n<li>One FireWire 400, two USB 2.0 ports, and ExpressCard/34 slot; no FireWire 800 slots<br></li>\r\n<li>Built-in 10/100/1000BASE-T (Gigabit); built-in 54 Mbps AirPort Extreme (802.11g); built-in Bluetooth 2.0+EDR<br></li>\r\n<li>15.4-inch TFT widescreen display with 1440 x 900 resolution</li>', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1 GB (single SODIMM) 667 MHz DDR2 SDRAM (PC2-5300)', 'Apple MacBook Pro MA464LL/A 15.4" Notebook PC (2.0 GHz Intel Core Duo, 1 GB RAM, 100 GB Hard Drive, SuperDrive)', 'Apple MacBook Pro MA464LL/A 15.4" Notebook PC (2.0 GHz Intel Core Duo, 1 GB RAM, 100 GB Hard Drive, SuperDrive) ', 'Apple MacBook Pro MA464LL/A 15.4" Notebook PC (2.0 GHz Intel Core Duo, 1 GB RAM, 100 GB Hard Drive, SuperDrive)', '2299.9900', 'MA464LL/A', NULL, '4', 2, 'Apple MacBook Pro MA464LL/A 15.4" Notebook PC', NULL, NULL, NULL, '2299.9900', NULL, NULL, '2.0 GHz Intel Core Duo processor with 2 MB shared L2 Cache', NULL, NULL, 0, NULL, NULL, NULL, NULL, '15.4-inch TFT widescreen display with 1440 x 900 resolution', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'You''ve seen improvements in notebook performance before - but never on this scale. The Intel Core Duo powering MacBook Pro is actually two processors built into a single chip.', 'MA464LL/A', NULL, '/s/e/sell-apple-macbook-pro-mc700ll-a-13-3-inch-laptop_5.jpg', NULL, NULL, NULL, NULL, 2, '/s/e/sell-apple-macbook-pro-mc700ll-a-13-3-inch-laptop_5.jpg', NULL, '2013-01-25 02:25:15', 'apple-macbook-pro-ma464ll-a-15-4-notebook-pc-2-0-ghz-intel-core-duo-1-gb-ram-100-gb-hard-drive-superdrive', 'apple-macbook-pro-ma464ll-a-15-4-notebook-pc-2-0-ghz-intel-core-duo-1-gb-ram-100-gb-hard-drive-superdrive.html', 4, '10.6000', NULL),
(26, 39, 'simple', NULL, 24, 'Black', 79, 'Acer', NULL, NULL, '999.9900', NULL, NULL, NULL, '2007-08-24 07:35:16', NULL, NULL, '', ' Acer has flawlessly designed the Ferrari 3200, instilling it with exceptional performance, brilliant graphics, and lightning-fast connectivity. This exclusive edition is another striking symbol of cooperation between Acer and Ferrari -- two progressive companies with proud heritages built on passion, innovation, power and success.', '', 0, NULL, NULL, NULL, NULL, 0, NULL, '80 gig Western Digital', 1, '/s/o/sony-vaio-f-series-3d-multimedia-laptop_copy_3.jpg', NULL, ' <ul>\r\n<ul class="disc">\r\n<li>Mobile AMD Athlon 64 2800+<br></li>\r\n<li>1MB L2 Cache<br></li>\r\n<li>512MB of PC2700 DDR333 SDRAM<br></li>\r\n<li>2 RAM Slots (0 open - upgrading requires chip removal)<br></li>\r\n<li>RAM is upgradeable to 2GB</li>\r\n</ul>', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '512MB of PC2700 DDR333 SDRAM', 'Acer Ferrari 3200 Notebook Computer PC', 'Acer Ferrari 3200 Notebook Computer PC ', 'Acer Ferrari 3200 Notebook Computer PC', '1799.9900', 'LX.FR206.001', NULL, '4', 2, 'Acer Ferrari 3200 Notebook Computer PC', '2013-01-01 00:00:00', NULL, NULL, '1799.9900', NULL, NULL, 'Mobile AMD Athlon 64 2800+', NULL, NULL, 0, NULL, NULL, NULL, NULL, '15-inch, 200-nit, high-brightness TFT LCD screen ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'This exclusive edition is another striking symbol of cooperation between Acer and Ferrari -- two progressive companies with proud heritages built on passion, innovation, power and success', 'LX.FR206.001', NULL, '/s/o/sony-vaio-f-series-3d-multimedia-laptop_copy_3.jpg', NULL, NULL, NULL, NULL, 2, '/s/o/sony-vaio-f-series-3d-multimedia-laptop_copy_3.jpg', NULL, '2013-01-25 02:25:10', 'acer-ferrari-3200-notebook-computer-pc', 'acer-ferrari-3200-notebook-computer-pc.html', 4, '11.4000', NULL),
(27, 39, 'simple', NULL, 24, 'Black', 76, 'Sony', NULL, NULL, '899.9900', NULL, NULL, NULL, '2007-08-24 07:41:56', NULL, NULL, '', ' Weighing in at just an amazing 2.84 pounds and offering a sleek, durable carbon-fiber case in charcoal black. And with 4 to 10 hours of standard battery life, it has the stamina to power you through your most demanding applications. With the integrated wireless WAN, you can access the national Sprint Mobile Broadband service to extend your wireless coverage beyond LAN access networks and hotspots, giving you the freedom to go farther, do more, and stay connected.\r\n\r\n', '10.7 x 1.23 x 7.7 inches (WxHxD)', 0, NULL, NULL, NULL, NULL, 0, NULL, '100 GB Hard Drive', 0, '/1/0/10867-imac-2012-03_3.jpg', NULL, ' <ul>\r\n<ul class="disc">\r\n<li>Processor: The Ultra Low Voltage Intel Core Solo U1500 processor offers a 1.33 GHz speed paired with a fast 533 MHz front-side bus and large 2 MB L2 cache. (An L2, or secondary, cache temporarily stores data; and a larger L2 cache can help speed up your system''s performance. The FSB carries data between the CPU and RAM, and a faster front-side bus will deliver better overall performance.) The Core Solo processor delivers enhanced performance for today''s demanding applications such as CAD tools, 3-D and 2-D modeling, video editing, digital music, digital photography and gaming. And Intel''s Smart Cache technology enables smarter, more efficient cache and bus design for enhanced performance, responsiveness and power savings.</li>\r\n</ul>\r\n\r\n   ', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2 GB RAM', 'Sony VAIO VGN-TXN27N/B 11.1" Notebook PC (Intel Core Solo Processor U1500, 2 GB RAM, 100 GB Hard Drive, DVD±RW Drive, Vista Business) Charcoal Black', 'Sony, VAIO, VGN-TXN27N/B , Notebook, PC, Intel, 2 GB RAM, Laptop', 'Sony VAIO VGN-TXN27N/B 11.1" Notebook PC (Intel Core Solo Processor U1500, 2 GB RAM, 100 GB Hard Drive, DVD±RW Drive, Vista Business) Charcoal Black', '2699.9900', 'VGN-TXN27N/B', NULL, '4', 2, 'Sony VAIO VGN-TXN27N/B 11.1" Notebook PC', NULL, NULL, NULL, '2699.9900', NULL, NULL, 'Intel Core Solo Processor U1500', NULL, NULL, 0, NULL, NULL, NULL, NULL, '9 inches', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Take a load off your shoulders when you''re racing for your plane with the sleekly designed and ultra-portable Sony Vaio VGN-TXN27N/B notebook PC.', 'VGN-TXN27N/B', NULL, '/1/0/10867-imac-2012-03_3.jpg', NULL, NULL, NULL, NULL, 2, '/1/0/10867-imac-2012-03_3.jpg', NULL, '2013-01-25 02:25:03', 'sony-vaio-vgn-txn27n-b-11-1-notebook-pc', 'sony-vaio-vgn-txn27n-b-11-1-notebook-pc.html', 4, '2.8000', NULL),
(28, 39, 'simple', NULL, 24, 'Black', 74, 'Toshiba', NULL, NULL, '899.9900', NULL, NULL, NULL, '2007-08-24 07:47:57', NULL, NULL, '', 'Easily mobile at just 6 pounds, the Toshiba Satellite A135-S4527 makes it easy to get your work done with a large, bright 15.4-inch widescreen LCD. The XGA-resolution screen (1280 x 800) permits side-by-side viewing of documents for increased productivity. It''s also great for using as a media center, with Toshiba''s unique Express Media Player enabling you to bypass the system and access CDs and DVDs with a touch of button. This affordable notebook PC is powered by Intel''s 1.73 GHz Core Duo T2080 processor, which provides an optimized, multithreaded architecture for improved gaming and multitasking performance and efficient power consumption. It also offers a 120 GB hard drive, 1 GB of installed RAM (2 GB maximum), dual-layer/multi-format DVD drive that also burns CDs, integrated 54g wireless connectivity, and Intel GMA 950 video card with up to 256 MB of shared video RAM.\r\n\r\n', '17 x 7 x 13 inches', 0, NULL, NULL, NULL, NULL, 0, NULL, '60 GB hard drive', 0, '/h/p/hppavilion_2.jpg', NULL, ' <ul>\r\n<ul class="disc">\r\n<li>Processor: The Intel Core Duo T2080 processor is built with the Mobile Intel 945PM Express chipset, and it has a 1.73 GHz processor speed, fast 533 MHz front-side bus (FSB), and 1 MB L2 cache. (An L2, or secondary, cache temporarily stores data; and a larger L2 cache can help speed up your system''s performance. The FSB carries data between the CPU and RAM, and a faster front-side bus will deliver better overall performance.)</li>\r\n</ul>', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1 GB RAM', 'Toshiba M285-E 14" Convertible Notebook PC (Intel Core Duo Processor T2300E, 1 GB RAM, 60', 'Toshiba, notebook, laptop, intel, ', 'Toshiba Satellite A135-S4527 155.4" Notebook PC (Intel Pentium Dual Core Processor T2080, 1 GB RAM, 120 GB Hard Drive, SuperMulti DVD Drive, Vista Premium)', '1599.9900', 'M285-E', NULL, '4', 2, 'Toshiba M285-E 14"', NULL, NULL, NULL, '1599.9900', NULL, NULL, '1.66 GHz Intel Core Duo T2300E processor', NULL, NULL, 0, NULL, NULL, NULL, NULL, '14-inch screen ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Get the competitive edge with the Gateway M285-E. This widescreen Convertible Notebook functions as both a conventional notebook and a tablet.', 'M285-E', NULL, '/h/p/hppavilion_2.jpg', NULL, NULL, NULL, NULL, 2, '/h/p/hppavilion_2.jpg', NULL, '2013-01-25 02:24:56', 'toshiba-satellite-a135-s4527-155-4-notebook-pc-intel-pentium-dual-core-processor-t2080-1-gb-ram-120-gb-hard-drive-supermulti-dvd-drive-vista-premium', 'toshiba-satellite-a135-s4527-155-4-notebook-pc-intel-pentium-dual-core-processor-t2080-1-gb-ram-120-gb-hard-drive-supermulti-dvd-drive-vista-premium.html', 4, '10.0000', NULL),
