(151, 60, 'simple', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 112, '3.0 GHz', '2008-07-24 18:13:21', NULL, NULL, '', 'Intel® Core™2 Duo processor is the new brand name for our next-generation energy-efficient performance desktop and mobile processors. Formerly known by their codenames Conroe and Merom, the Intel® Core™2 processors for desktop and mobile computers are based on the Intel® Core™ microarchitecture, Intel''s new industry-leading foundation for all mobile, desktop and server platforms moving forward.', NULL, 0, NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, '/e/s/escentual10000301_0001-original.png', NULL, NULL, 0, NULL, NULL, NULL, 116, 'Intel', NULL, NULL, NULL, NULL, NULL, '', '', '', NULL, NULL, NULL, '4', 2, 'Intel C2D E8400 3.0GHz Retail', NULL, NULL, NULL, '98.9900', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Intel® Core™2 Duo processor is the new brand name for our next-generation energy-efficient performance desktop and mobile processors.', 'intelc2d', NULL, '/e/s/escentual10000301_0001-original.png', NULL, NULL, NULL, NULL, 1, '/e/s/escentual10000301_0001-original.png', NULL, '2013-01-25 10:46:53', 'intel-c2d-e8400-3-0ghz-retail', 'intel-c2d-e8400-3-0ghz-retail.html', 4, '1.0000', NULL),
(152, 61, 'simple', NULL, NULL, NULL, NULL, NULL, 106, '10000:1', NULL, NULL, NULL, NULL, '2008-07-24 18:14:11', NULL, NULL, '', 'With ultrafine 10,000:1 contrast and wide 170° viewing angles, this 24" widescreen LCD monitor delivers crystal-clear high-definition visuals for gaming and work projects. The DVI-D input lets you connect a DVD player or other digital video device.\r\n\r\nProduct Features:\r\n    * Ultrafast 5 ms response time\r\n    * Digital Fine 10,000:1 contrast ratio; 400 cd/m² brightness\r\n    * 1920 x 1200 maximum resolution; wide 170° horizontal and vertical viewing angles\r\n', NULL, 0, NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, '/0/9/09474209082008_5211791_1.jpg', NULL, NULL, 0, NULL, NULL, NULL, 1, 'LG', '1920x1200', NULL, NULL, NULL, NULL, '', '', '', NULL, NULL, NULL, '4', 2, '24" Widescreen Flat-Panel LCD Monitor', NULL, NULL, NULL, '699.9900', NULL, NULL, NULL, NULL, NULL, 0, '5ms', NULL, NULL, NULL, '24"', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '5 ms response time; 10,000:1 contrast ratio; 400 cd/m² brightness; 1920 x 1200 maximum resolution; DVI-D and 15-pin D-sub inputs', 'W2452T-TF', NULL, '/0/9/09474209082008_5211791_1.jpg', NULL, NULL, NULL, NULL, 1, '/0/9/09474209082008_5211791_1.jpg', NULL, '2013-01-25 23:34:26', '24-widescreen-flat-panel-lcd-monitor', '24-widescreen-flat-panel-lcd-monitor.html', 4, '1.0000', NULL),
(153, 60, 'simple', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 114, '3.2 GHz', '2008-07-24 18:15:29', NULL, NULL, '', 'The new Intel® Core™2 Extreme processor QX9775 with hafnium-infused chip design delivers unrivaled gaming performance1 with four independent processing cores, 12 MB of cache, 1600 MHz Front Side Bus, and clock speeds of 3.2 GHz.The Intel® Core™2 Extreme processor is the world’s first quad core desktop processor, delivering the latest in cutting-edge processor technology and unprecedented performance across a wide range of applications and benchmarks. All Intel Core 2 Extreme processor QX9000 series are based on the industry-leading 45nm manufacturing technology, providing another giant leap forward on the road to multi-core and parallel computing.', NULL, 0, NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, '/1/0/10000383_0001-original.png', NULL, NULL, 0, NULL, NULL, NULL, 116, 'Intel', NULL, NULL, NULL, NULL, NULL, '', '', '', NULL, NULL, NULL, '4', 2, 'Intel Core 2 Extreme QX9775 3.20GHz Retail', '2013-01-01 00:00:00', NULL, NULL, '2049.9900', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Intel Core 2 Extreme QX9775 Processor BX80574QX9775 - 45nm, 3.20GHz, 12MB Cache, 1600MHz FSB, Yorkfield XE, Quad-Core, Retail, Socket 771, Processor', 'intelcore2extreme', NULL, '/1/0/10000383_0001-original.png', NULL, NULL, NULL, NULL, 1, '/1/0/10000383_0001-original.png', NULL, '2013-01-25 10:44:55', 'intel-core-2-extreme-qx9775-3-20ghz-retail', 'intel-core-2-extreme-qx9775-3-20ghz-retail.html', 4, '1.0000', NULL),
