(156, 61, 'simple', NULL, NULL, NULL, NULL, NULL, 106, '10000:1', NULL, NULL, NULL, NULL, '2008-07-24 18:16:51', NULL, NULL, '', 'Experience smooth gaming visuals and crystal-clear video with this 19" flat-panel LCD monitor that features an ultrafast 2 ms response time and sharp 10,000:1 contrast. The DVI-D with HDCP input lets you connect a DVD player or other digital video device.\r\nProduct Features\r\n\r\n    * Ultrafast 2 ms response time\r\n    * Digital Fine 10,000:1 contrast ratio; 300 cd/m² brightness\r\n    * 1440 x 900 maximum resolution; wide 170° horizontal and vertical viewing angles\r\n', NULL, 0, NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, '/i/n/index_1.jpg', NULL, NULL, 0, NULL, NULL, NULL, 1, 'LG', '1440x900', NULL, NULL, NULL, NULL, '', '', '', NULL, NULL, NULL, '4', 2, '19" Widescreen Flat-Panel LCD Monitor', '2013-01-01 00:00:00', NULL, NULL, '399.9900', NULL, NULL, NULL, NULL, NULL, 0, '2ms', NULL, NULL, NULL, '19"', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2 ms response time; 10,000:1 contrast ratio; 300 cd/m² brightness; 1440 x 900 maximum resolution; DVI-D and 15-pin D-sub inputs', 'W1952TQ-TF', NULL, '/i/n/index_1.jpg', NULL, NULL, NULL, NULL, 0, '/i/n/index_1.jpg', NULL, '2013-01-25 23:33:17', '19-widescreen-flat-panel-lcd-monitor', '19-widescreen-flat-panel-lcd-monitor.html', 4, '1.0000', NULL),
(157, 61, 'simple', NULL, NULL, NULL, NULL, NULL, 107, '1500:1', NULL, NULL, NULL, NULL, '2008-07-24 18:19:30', NULL, NULL, '', '    * Digital (DVI), USB 2.0 and FireWire 400 inputs\r\n    * Cinema HD delivers up to 16.7 million colors across a wide gamut for a breathtaking, vivid picture\r\n    * ColorSync technology lets you create a custom profile to maintain consistent colors on the screen and in print\r\n    * Single cable with breakout for DVI, USB and FireWire ports provides a tidy look while reducing clutter\r\n    * Built-in, 2-port USB 2.0 hub to easily connect peripheral devices\r\n    * User controls allow you to monitor display power, system sleep/wake, brightness and monitor tilt\r\n    * Antiglare, hard-coat screen treatment\r\n    * Wall-mountable with optional mounting kit (not included)\r\n    * ENERGY STAR compliance assures a high standard of energy efficiency\r\n', NULL, 0, NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, '/s/a/sam-pla-ps51e490-bk.png', NULL, NULL, 0, NULL, NULL, NULL, 29, 'Apple', '1920x1200', NULL, NULL, NULL, NULL, '', '', '', NULL, NULL, NULL, '4', 2, '30" Flat-Panel TFT-LCD Cinema HD Monitor', '2013-01-01 00:00:00', NULL, NULL, '699.9900', NULL, NULL, NULL, NULL, NULL, 0, '15ms', NULL, NULL, NULL, '30"', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Computer games, digital photo editing and graphic applications will astound you on this huge 30" flat-panel monitor. Cinema HD and ColorSync technology let you enjoy 16.7 million breathtaking colors and custom profiling for color consistency.', 'M9179LL', NULL, '/s/a/sam-pla-ps51e490-bk.png', NULL, NULL, NULL, NULL, 0, '/s/a/sam-pla-ps51e490-bk.png', NULL, '2013-01-25 23:31:25', '30-flat-panel-tft-lcd-cinema-hd-monitor', '30-flat-panel-tft-lcd-cinema-hd-monitor.html', 4, '1.0000', NULL),
(158, 39, 'bundle', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2008-07-24 18:21:23', NULL, NULL, '', ' <ul>\r\n<ul class="disc">\r\n<li>Processor: The Ultra Low Voltage Intel Core Solo U1500 processor offers a 1.33 GHz speed paired with a fast 533 MHz front-side bus and large 2 MB L2 cache. (An L2, or secondary, cache temporarily stores data; and a larger L2 cache can help speed up your system''s performance. The FSB carries data between the CPU and RAM, and a faster front-side bus will deliver better overall performance.) The Core Solo processor delivers enhanced performance for today''s demanding applications such as CAD tools, 3-D and 2-D modeling, video editing, digital music, digital photography and gaming. And Intel''s Smart Cache technology enables smarter, more efficient cache and bus design for enhanced performance, responsiveness and power savings.</li>\r\n</ul>\r\n', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '/s/e/sell-apple-macbook-pro-mc700ll-a-13-3-inch-laptop_1.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sony VAIO VGN-TXN27N/B 11.1" Notebook PC (Intel Core Solo Processor U1500, 2 GB RAM, 100 GB Hard Drive, DVD±RW Drive, Vista Business) Charcoal Black', 'Sony, VAIO, VGN-TXN27N/B , Notebook, PC, Intel, 2 GB RAM, ', 'Sony VAIO VGN-TXN27N/B 11.1" Notebook PC (Intel Core Solo Processor U1500, 2 GB RAM, 100 GB Hard Drive, DVD±RW Drive, Vista Business) Charcoal Black', NULL, NULL, NULL, NULL, 0, 'Sony VAIO 11.1" Notebook PC', '2013-01-01 00:00:00', NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, 'Weighing in at just an amazing 2.84 pounds and offering a sleek, durable carbon-fiber case in charcoal black. And with 4 to 10 hours of standard battery life, it has the stamina to power you through your most demanding applications. With the integrated wireless WAN, you can access the national Sprint Mobile Broadband service to extend your wireless coverage beyond LAN access networks and hotspots, giving you the freedom to go farther, do more, and stay connected.\r\n\r\n', 'VGN-TXN27N/BW', 1, '/s/e/sell-apple-macbook-pro-mc700ll-a-13-3-inch-laptop_1.jpg', NULL, NULL, NULL, NULL, 0, '/s/e/sell-apple-macbook-pro-mc700ll-a-13-3-inch-laptop_1.jpg', NULL, '2013-01-25 02:24:50', 'sony-vaio-vgn-txn27n-b-11-1-notebook-pc', 'sony-vaio-vgn-txn27n-b-11-1-notebook-pc-163.html', 4, NULL, 0),
(159, 9, 'simple', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2008-07-24 18:22:14', NULL, NULL, '', 'The most comfortable ergonomic keyboard on the market! We just made a great deal for this Microsoft Natural ergonomic keyboard. And we know you’re going to love it. This newest addition to the world’s best selling line of ergonomic keyboards features a natural wrist alignment that will make your day! Just one touch allows you to perform a wealth of common but important tasks such as opening documents and replying to e-mail. The Microsoft Natural Model 4000 ergonomic keyboard also features an improved number pad with easy-to-reach symbols such left and right, equal sign and back space placed just above the number pad. Easy-access to the Internet. Multimedia keys. Lockable F keys and much more (see complete list of additional features below). Don’t you think it’s time to go natural? Microsoft’s Natural Ergonomic Model 4000 Keyboard. Available right here, for the best price!', NULL, 0, NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, '/2/3/23113432202002-20_1.png', NULL, NULL, 0, NULL, NULL, NULL, 120, 'Microsoft', NULL, NULL, NULL, NULL, NULL, '', '', '', NULL, NULL, NULL, '4', 2, 'Microsoft Natural Ergonomic Keyboard 4000', '2013-01-01 00:00:00', NULL, NULL, '99.9900', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'The most comfortable ergonomic keyboard on the market! We just made a great deal for this Microsoft Natural ergonomic keyboard.', 'microsoftnatural', NULL, '/2/3/23113432202002-20_1.png', NULL, NULL, NULL, NULL, 0, '/2/3/23113432202002-20_1.png', NULL, '2013-01-25 10:34:09', 'microsoft-natural-ergonomic-keyboard-4000', 'microsoft-natural-ergonomic-keyboard-4000.html', 4, '1.0000', NULL);
