INSERT INTO `core_email_template` (`template_id`, `template_code`, `template_text`, `template_styles`, `template_type`, `template_subject`, `template_sender_name`, `template_sender_email`, `added_at`, `modified_at`, `orig_template_code`, `orig_template_variables`) VALUES
(1, 'Order for User', '<body style="background:#F6F6F6; font-family:Verdana, Arial, Helvetica, sans-serif; font-size:12px; margin:0; padding:0; color:#646464">\r\n<div style="background:#F6F6F6; font-family:Verdana, Arial, Helvetica, sans-serif; font-size:12px; margin:0; padding:0;">\r\n<table cellspacing="0" cellpadding="0" border="0" width="100%">\r\n<tr>\r\n    <td align="left" valign="top" style="padding:20px 0 20px 0">\r\n        <table bgcolor="#FFFFFF" cellspacing="0" cellpadding="10" border="0" width="650" style="border:1px solid #E0E0E0;">\r\n            <!-- [ header starts here] -->\r\n            <tr>\r\n                <td align="center" valign="top" style="background:#001748"><a href="{{store url=""}}"><img src="{{skin url="images/logo.gif" _area=''frontend''}}" alt="{{var logo_alt}}" style="margin-bottom:10px;" border="0"/></a></td>\r\n            </tr>\r\n            <!-- [ middle starts here] -->\r\n            <tr>\r\n                <td valign="top">\r\n                    <h1 style="font-size:12px; font-weight:bold; line-height:22px; margin:0 0 11px 0; color:#f44d00">Hello, {{htmlescape var=$order.getCustomerName()}}</h1>\r\n                    <p style="font-size:12px; line-height:16px; margin:0;">\r\n                        Thank you for your order from {{var store.getFrontendName()}}.\r\n                        Once your package ships we will send an email with a link to track your order.\r\n                        You can check the status of your order by <a href="{{store url="customer/account/"}}" style="color:#323232;">logging into your account</a>.\r\n                        If you have any questions about your order please contact us at <a href="mailto:{{config path=''trans_email/ident_support/email''}}" style="color:#323232;">{{config path=''trans_email/ident_support/email''}}</a> or call us at <span class="nobr">{{config path=''general/store_information/phone''}}</span> Monday - Friday, 8am - 5pm PST.\r\n                    </p>\r\n                    <p style="font-size:12px; line-height:16px; margin:0;">Your order confirmation is below. Thank you again for your business.</p>\r\n            </tr>\r\n            <tr>\r\n                <td>\r\n                    <h2 style="font-size:12px; font-weight:normal; margin:0; color:#323232">Your Order #{{var order.increment_id}} <small>(placed on {{var order.getCreatedAtFormated(''long'')}})</small></h2>\r\n                </td>\r\n            </tr>\r\n            <tr>\r\n                <td>\r\n                    <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n                        <thead>\r\n                        <tr>\r\n                            <th align="left" width="325" style="font-size:16px; padding:5px 9px 6px 9px; line-height:1em; color:#f44d00; text-transform:uppercase; font-weight:normal">Billing Information:</th>\r\n                            <th width="10"></th>\r\n                            <th align="left" width="325" style="font-size:16px; padding:5px 9px 6px 9px; line-height:1em; color:#f44d00; text-transform:uppercase; font-weight:normal">Payment Method:</th>\r\n                        </tr>\r\n                        </thead>\r\n                        <tbody>\r\n                        <tr>\r\n                            <td valign="top" style="font-size:12px; padding:7px 9px 9px 9px;">\r\n                                {{var order.getBillingAddress().format(''html'')}}\r\n                            </td>\r\n                            <td>&nbsp;</td>\r\n                            <td valign="top" style="font-size:12px; padding:7px 9px 9px 9px;">\r\n                                {{var payment_html}}\r\n                            </td>\r\n                        </tr>\r\n                        </tbody>\r\n                    </table>\r\n                    <br/>\r\n                    {{depend order.getIsNotVirtual()}}\r\n                    <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n                        <thead>\r\n                        <tr>\r\n                            <th align="left" width="325" style="font-size:16px; padding:5px 9px 6px 9px; line-height:1em; color:#f44d00; text-transform:uppercase; font-weight:normal">Shipping Information:</th>\r\n                            <th width="10"></th>\r\n                            <th align="left" width="325" style="font-size:16px; padding:5px 9px 6px 9px; line-height:1em; color:#f44d00; text-transform:uppercase; font-weight:normal">Shipping Method:</th>\r\n                        </tr>\r\n                        </thead>\r\n                        <tbody>\r\n                        <tr>\r\n                            <td valign="top" style="font-size:12px; padding:7px 9px 9px 9px;">\r\n                                {{var order.getShippingAddress().format(''html'')}}\r\n                                &nbsp;\r\n                            </td>\r\n                            <td>&nbsp;</td>\r\n                            <td valign="top" style="font-size:12px; padding:7px 9px 9px 9px;">\r\n                                {{var order.getShippingDescription()}}\r\n                                &nbsp;\r\n                            </td>\r\n                        </tr>\r\n                        </tbody>\r\n                    </table>\r\n                    <br/>\r\n                    {{/depend}}\r\n                    {{layout handle="sales_email_order_items" order=$order}}\r\n                    <p style="font-size:12px; margin:0 0 10px 0">{{var order.getEmailCustomerNote()}}</p>\r\n                </td>\r\n            </tr>\r\n            <tr>\r\n                <td align="left" style="text-align:left;"><p style="font-size:12px; margin:0;">Thank you,<br/><strong style="font-weight:normal; color:#323232">{{var store.getFrontendName()}}</strong></p></td>\r\n            </tr>\r\n        </table>\r\n    </td>\r\n</tr>\r\n</table>\r\n</div>\r\n</body>', 'body,td { color:#2f2f2f; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; }', 2, '{{var store.getFrontendName()}}: New Order # {{var order.increment_id}}', NULL, NULL, NULL, '2013-02-04 02:21:20', 'sales_email_order_template', '{"store url=\\"\\"":"Store Url","var logo_url":"Email Logo Image Url","var logo_alt":"Email Logo Image Alt","htmlescape var=$order.getCustomerName()":"Customer Name","var store.getFrontendName()":"Store Name","store url=\\"customer/account/\\"":"Customer Account Url","var order.increment_id":"Order Id","var order.getCreatedAtFormated(''long'')":"Order Created At (datetime)","var order.getBillingAddress().format(''html'')":"Billing Address","var payment_html":"Payment Details","var order.getShippingAddress().format(''html'')":"Shipping Address","var order.getShippingDescription()":"Shipping Description","layout handle=\\"sales_email_order_items\\" order=$order":"Order Items Grid","var order.getEmailCustomerNote()":"Email Order Note"}'),
(2, 'Order for Guest', '<body style="background:#F6F6F6; font-family:Verdana, Arial, Helvetica, sans-serif; font-size:12px; margin:0; padding:0; color:#646464">\r\n<div style="background:#F6F6F6; font-family:Verdana, Arial, Helvetica, sans-serif; font-size:12px; margin:0; padding:0;">\r\n<table cellspacing="0" cellpadding="0" border="0" height="100%" width="100%">\r\n<tr>\r\n    <td align="left" valign="top" style="padding:20px 0 20px 0">\r\n        <!-- [ header starts here] -->\r\n        <table bgcolor="#FFFFFF" cellspacing="0" cellpadding="10" border="0" width="650" style="border:1px solid #E0E0E0;">\r\n            <tr>\r\n                <td align="center" valign="top" style="background:#001748"><a href="{{store url=""}}"><img src="{{skin url="images/logo.gif" _area=''frontend''}}" alt="{{var logo_alt}}" style="margin-bottom:10px;" border="0"/></a></td>\r\n            </tr>\r\n        <!-- [ middle starts here] -->\r\n            <tr>\r\n                <td valign="top">\r\n                    <h1 style="font-size:12px; font-weight:bold; line-height:22px; margin:0 0 11px 0; color:#f44d00">Hello, {{htmlescape var=$billing.getName()}}</h1>\r\n                    <p style="font-size:12px; line-height:16px; margin:0;">\r\n                        Thank you for your order from {{var store.getFrontendName()}}.\r\n                        If you have any questions about your order please contact us at <a href="mailto:{{config path=''trans_email/ident_support/email''}}" style="color:#323232;">{{config path=''trans_email/ident_support/email''}}</a> or call us at <span class="nobr">{{config path=''general/store_information/phone''}}</span> Monday - Friday, 8am - 5pm PST.\r\n                    </p>\r\n                </td>\r\n            </tr>\r\n            <tr>\r\n                <td>\r\n                    <h2 style="font-size:12px; font-weight:normal; margin:0; color:#323232">Your Invoice #{{var invoice.increment_id}} for Order #{{var order.increment_id}}</h2>\r\n                </td>\r\n            </tr>\r\n            <tr>\r\n                <td>\r\n                    <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n                        <thead>\r\n                        <tr>\r\n                            <th align="left" width="325" style="font-size:16px; padding:5px 9px 6px 9px; line-height:1em; color:#f44d00; text-transform:uppercase; font-weight:normal">Billing Information:</th>\r\n                            <th width="10"></th>\r\n                            <th align="left" width="325" style="font-size:16px; padding:5px 9px 6px 9px; line-height:1em; color:#f44d00; text-transform:uppercase; font-weight:normal">Payment Method:</th>\r\n                        </tr>\r\n                        </thead>\r\n                        <tbody>\r\n                        <tr>\r\n                            <td valign="top" style="font-size:12px; padding:7px 9px 9px 9px; ">\r\n                                {{var order.billing_address.format(''html'')}}\r\n                            </td>\r\n                            <td>&nbsp;</td>\r\n                            <td valign="top" style="font-size:12px; padding:7px 9px 9px 9px; ">\r\n                                {{var payment_html}}\r\n                            </td>\r\n                        </tr>\r\n                        </tbody>\r\n                    </table>\r\n                    <br/>\r\n                    {{depend order.getIsNotVirtual()}}\r\n                    <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n                        <thead>\r\n                        <tr>\r\n                            <th align="left" width="650" style="font-size:16px; padding:5px 9px 6px 9px; line-height:1em; color:#f44d00; text-transform:uppercase; font-weight:normal">Shipping Information:</th>\r\n                            <th width="10"></th>\r\n                            <th align="left" width="650" style="font-size:16px; padding:5px 9px 6px 9px; line-height:1em; color:#f44d00; text-transform:uppercase; font-weight:normal">Shipping Method:</th>\r\n                        </tr>\r\n                        </thead>\r\n                        <tbody>\r\n                        <tr>\r\n                            <td valign="top" style="font-size:12px; padding:7px 9px 9px 9px; ">\r\n                                {{var order.shipping_address.format(''html'')}}\r\n                                &nbsp;\r\n                            </td>\r\n                            <td>&nbsp;</td>\r\n                            <td valign="top" style="font-size:12px; padding:7px 9px 9px 9px; ">\r\n                                {{var order.shipping_description}}\r\n                                &nbsp;\r\n                            </td>\r\n                        </tr>\r\n                        </tbody>\r\n                    </table>\r\n                    <br/>\r\n                    {{/depend}}\r\n                    {{layout handle="sales_email_order_invoice_items" invoice=$invoice order=$order}}\r\n                    <p style="font-size:12px; margin:0 0 10px 0">{{var comment}}</p>\r\n                </td>\r\n            </tr>\r\n            <tr>\r\n                <td align="left" style="text-align:left;"><p style="font-size:12px; margin:0;">Thank you again,<br/><strong style="font-weight:normal; color:#323232">{{var store.getFrontendName()}}<strong></p></td>\r\n            </tr>\r\n        </table>\r\n    </td>\r\n</tr>\r\n</table>\r\n</div>\r\n</body>', 'body,td { color:#2f2f2f; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; }', 2, '{{var store.getFrontendName()}}: New Order # {{var order.increment_id}}', NULL, NULL, NULL, '2013-02-04 02:21:56', 'sales_email_order_guest_template', '{"store url=\\"\\"":"Store Url","var logo_url":"Email Logo Image Url","var logo_alt":"Email Logo Image Alt","htmlescape var=$order.getBillingAddress().getName()":"Guest Customer Name","var store.getFrontendName()":"Store Name","var order.increment_id":"Order Id","var order.getCreatedAtFormated(''long'')":"Order Created At (datetime)","var order.getBillingAddress().format(''html'')":"Billing Address","var payment_html":"Payment Details","var order.getShippingAddress().format(''html'')":"Shipping Address","var order.getShippingDescription()":"Shipping Description","layout handle=\\"sales_email_order_items\\" order=$order":"Order Items Grid","var order.getEmailCustomerNote()":"Email Order Note"}');
