(109, 109, NULL, 'Loved It', 'Awesome Phone!', 'Phonelover', 1),
(110, 110, 1, 'Awful Product', 'I have had nothing but problems with this product. When I received the computer the box was broken. I didn''t think anything of it but when powered on the computer had a loud whirling sound. A few hours later it refused to turn on. It appears the cheap internal fan broke. I got a new one 2 weeks later. This time the optical drive broke 3 weeks later. I was beginning to become frustrated. After calling customer service they refused to give me a full refund because it had been over 60 days since I first bought it. I hesitantly accepted a third replacement. This one works but the shift button broke already and power cord no longer fits into the computer snugly. I ended up selling it to my cousin and buying a Mac.', 'SupaStar', NULL),
